  false,\n\t\"url\": null,\n\t\"notes\": \"The Base Flood Elevation (BFE) table is
  required for any digital data where BFE lines will be shown on the corresponding
  Flood Insurance Rate Map (FIRM). Normally if there are any riverine AE zones, BFE
  lines are required. The S_BFE table contains information about the BFEs within a
  study area. A spatial file with locational information also corresponds with this
  data table. BFE lines indicate the rounded whole-foot water surface elevation of
  the 1-percent-annual-chance flood. The spatial elements representing BFE features
  are lines extending from Special Flood Hazard Area (SFHA) boundary to SFHA boundary.
  The BFE lines will have no visible gaps or overshoots between the SFHA boundary
  and the end of the BFE line at the publication scale of the DFIRM. However, the
  ends of the BFE lines are not necessarily snapped precisely to the SFHA boundary.
  Each BFE is represented by a single line. While BFE lines are depicted as wavy lines
  on the hardcopy FIRM, they should be primarily straight lines in the spatial data,
  although they may bend consistent with procedures described in Volume 1 of these
  Guidelines. This is a Standard DFIRM Database table. More information can be found
  in the document 'Guidelines and Specifications for Flood Hazard Mapping Partners
  Appendix LGuidance for Preparing Draft Digital Data and DFIRM Database' located
  on this disk.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
